import logo from './logo.svg';
import './App.css';
import Header from './Header'
import { BrowserRouter, Route, Switch } from 'react-router-dom'

import Login from './Login'
import Register from './Register';
import AddProduct from './AddProduct';
import UpdateProduct from './UpdateProduct';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <div>
          swi
          <Route path={"/login"}>
            <Login />
          </Route>
          <Route path={"/register"}>
            <Register />
          </Route>
          <Route path={"/add"}>
            <AddProduct />
          </Route>
          <Route path={"/update"}>
            <UpdateProduct />
          </Route>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
